import React from "react";
import { Col } from "react-bootstrap"; 

function IntroCard(props){
    return (
        <Col md={{span: 3, offset: 1}}>
            <div className="icon">

            </div>
            <div>
                {props.children}
                <h3>{props.title}</h3>
                <p>{props.info}</p>
            </div>
        </Col>
    );
}

export default IntroCard;
